import React from "react";
import axios from "axios";
import SearchBar from "./SearchBar";

class App extends React.Component {
    onSearchSubmit(term) {
        axios.get("", {
            headers: {
                Authorization
            }
        });
    }

    render() {
        return (
            <div className="ui container" style={{marginTop: "20px"}}>
                <SearchBar onSubmit={this.onSearchSubmit}/>
            </div>
        );
    }
}

export default App;
